export const initialState = {
  currentChat: null,
};

const reducer = (state, action) => {
  switch (action.type) {
    // User code started
    case "OPEN_CHAT":
      return {
        ...state,
        currentChat: action.currentChat,
      };
    default:
      return state;
  }
};

export default reducer;
